embedfield:
How to find the length of strings (phrases) in mongodb and sort them according to length?<p>I have tried finding the length of the phrases it works perfectly but when i sort it according to length it gives the error that "$strLenCP requires a string argument, found: int".
I have tried this: <a href="https://stackoverflow.com/a/44161848">https://stackoverflow.com/a/44161848</a> but it gives error as below: </p>

<blockquote>
  <p>db.abcd.aggregate({$project: {"phrases":1,"length": { $strLenCP: "$phrases" }}}) </p>
</blockquote>

<pre><code>{ "_id" : ObjectId("5dfa08aceb51324106482d0b"), "phrases" : "the dupont safety management evaluation", "length" : 39 } 
{ "_id" : ObjectId("5dfa08aceb51324106482d0c"), "phrases" : "its factory sites", "length" : 17 } 
{ "_id" : ObjectId("5dfa08aceb51324106482d0d"), "phrases" : "dupont’s international standards", "length" : 32 } 
{ "_id" : ObjectId("5dfa08aceb51324106482d11"), "phrases" : "our safety systems winner", "length" : 25 } 
{ "_id" : ObjectId("5dfa08aceb51324106482d15"), "phrases" : "a stringent selection", "length" : 21 } 
{ "_id" : ObjectId("5dfa08aceb51324106482d16"), "phrases" : "rigorous evaluation process", "length" : 27 } 
</code></pre>

<blockquote>
  <p>db.abcd.aggregate([{$project: {"phrases":1,"length": { $strLenCP: "$phrases" }}},{$sort:{"length":-1}}]) </p>
</blockquote>

<pre><code>2019-12-20T09:30:54.020+0530 E  QUERY    [js] uncaught exception: Error: command failed: { 

        "ok" : 0, 
        "errmsg" : "$strLenCP requires a string argument, found: int", 
        "code" : 34471, 
        "codeName" : "Location34471" 
}: aggregate failed. 
</code></pre>

<p>Is there any solution for the same? Please suggest me. </p>

