embedfield:
MongoDB: How to get Object value of lookup collection<p>I'm new on MongoDB. I want to find object value to lookup collection.</p>

<p>Here are the collections:</p>

<p>Langauge:</p>

<pre><code>{
  _id: 15,
  language:English,
  status: Active
},
{
  _id: 20,
  language:Spanish,
  status: Active
},
</code></pre>

<p>Category:</p>

<p>Here <code>15, 20</code> is language ID in <code>name</code> Object</p>

<pre><code>{
  _id: 1,
  name: { 
          15: Office,
          20: Oficina 
        },
  status: Active
},
{
  _id: 2,
  name: { 
          15: Restaurant,
          20: Restaurante 
        },
  status: Active
 },
</code></pre>

<p>Property:</p>

<pre><code>
{
  _id: 1,
  name: { 
          15: Lake View,
          20: Vista al lago 
        },
  cat_id : 1
  status: Active
},
{
  _id: 2,
  name: { 
          15: The Apple,
          20: La manzana 
        },
  cat_id : 1
  status: Active
 },
{
  _id: 3,
  name: { 
          15: Blue Monday,
          20: Lunes azul 
        },
  cat_id : 2
  status: Active
 },
</code></pre>

<p>Query:</p>

<pre><code>var langId = 15;
db.Property.aggregate([
  {
    $lookup:
      {
        from: 'Category',
        localField: 'cat_id',
        foreignField: '_id',
        as: 'catdetails',
      },
  },
  {
    $project: {
      _id: 1,
      name: `$name.${langId}`,
      cat_id: 1,
      status: 1,
      'catdetails._id': 1,
      'catdetails.name': `$catdetails.name.${langId}`,
      'catdetails.status': 1,
    },
  },
]);

</code></pre>

<p>Result:</p>

<pre><code>[
  {
    "_id": 1,
    "name": "Lake View",
    "cat_id": 1,
    "status": "Active",
    "catdetails": {
                    "_id": "1",
                    "name":[ "Office" ],
                  }
   },
   {
    "_id": 2,
    "name": "The Apple",
    "cat_id": 2,
    "status": "Active",
    "catdetails": {
                    "_id": "1",
                    "name":[ "Office" ],
                  }
   },
   {
    "_id": 3,
    "name": "Blue Monday",
    "cat_id": 2,
    "status": "Active",
    "catdetails": {
                    "_id": 2,
                    "name":[ "Restaurant" ],
                  }
   },
]
</code></pre>

<p>In Result in catdetails Object <code>name</code> comes in array symbol like this <code>"name":[ "Restaurant" ]</code> I want this without array symbol like this <code>"name":"Restaurant"</code></p>

<p>Expected Result:</p>

<pre><code>[
  {
    "_id": 1,
    "name": "Lake View",
    "cat_id": 1,
    "status": "Active",
    "catdetails": {
                    "_id": "1",
                    "name":"Office",
                  }
   },
   {
    "_id": 2,
    "name": "The Apple",
    "cat_id": 2,
    "status": "Active",
    "catdetails": {
                    "_id": "1",
                    "name":"Office",
                  }
   },
   {
    "_id": 3,
    "name": "Blue Monday",
    "cat_id": 2,
    "status": "Active",
    "catdetails": {
                    "_id": 2,
                    "name":"Restaurant",
                  }
   },
]
</code></pre>

<p>How can I change in my query to this type of result? </p>

