Aggregation at each document level mongodb<p>I have a list of documents like this</p>

<pre><code>[{
        "_id": "5dbc95f921d7625303fe2369",
        "name": "John",
        "itemsPurchased": [{
                "offer": "o1",
                "items": ["p1"]
            },{
                "offer": "o1",
                "items": ["p1"]
            },
            {
                "offer": "o1",
                "items": ["p2"]
            },
            {
                "offer": "o2",
                "items": ["p1"]
            }, {
                "offer": "o7",
                "items": ["p1"]
            }
        ]
    },
    {
        "_id": "zbc95f921d7625303fe2363",
        "name": "Doe",
        "itemsPurchased": [{
                "offer": "o1",
                "items": ["p11"]
            },{
                "offer": "o1",
                "items": ["p11"]
            },
            {
                "offer": "o2",
                "items": ["p13"]
            },
            {
                "offer": "o1",
                "items": ["p22"]
            },
            {
                "offer": "o2",
                "items": ["p11"]
            }, {
                "offer": "o3",
                "items": ["p11"]
            }
        ]
    }
]
</code></pre>

<p>And i am trying to compute unique offers on unique products by each customer, expecting the resultant to be like:</p>

<pre><code>[
  {
    "_id": "5dbc95f921d7625303fe2369",
    "name": "John",
    "offersAndProducts": {
      "o1":2,
      "o2":2,
      "o3":1
},
{
  "_id": "zbc95f921d7625303fe2363",
    "name": "Doe",
    "offersAndProducts": {
      "o1":2,
      "o2":1,
      "o7":1
    }
]
</code></pre>

<p>I want to apply aggregations per document, After performing $unwind on itemsPurchased, applied $group on items and then on offer to eliminate the duplication:</p>

<pre><code>{ 
            "$group" : {
                "_id" : {
                    "item" : {
                        "$arrayElemAt" : [
                            "$itemsPurchased.item", 
                            0.0
                        ]
                    }, 
                    "count" : {
                        "$sum" : 1.0
                    }, 
                    "offer" : "$itemsPurchased.offer"
                }
            }
        }
</code></pre>

<p>then,</p>

<pre><code>{ 
            "$group" : {
                "_id" : "$_id.offer", 
                "count" : {
                    "$sum" : 1.0
                }
            }
        }
</code></pre>

<p>this gives the array of products and offers for all documents:</p>

<pre><code>[
{o1:4,o2:3,o3:1,o7:1}
] 
</code></pre>

<p>But i need it at document level.
tried <code>$addFeild</code>, but <code>$unwind</code> and $match operators gives invalid error.</p>

<p>Any other way of achieving this?</p>

